import './banner.css'

function Banner(){
    // JSX o código abaixo parece html, mas não é. JSX é uma extensão de sintaxe para JavaScript que permite escrever marcações semelhantes a HTML dentro de um arquivo JavaScript
    return (
        <img src="/imagens/banner.png" alt="banner principal da página do organo"/>
    )

}

export default Banner
